import { string } from 'prop-types';
import styled from 'styled-components'

import { v4 as uuidv4 } from 'uuid';


const Wrapper = styled.div`
    width: 100%;
    height: 100%;
    display: flex;
`;

const Colom1 = styled.div`
    width: 25%;
    background: ${({ theme }) => theme.buttonColor1};
    color: ${({ theme }) => theme.themeColor1};
    padding: 50px 20px;
`;

const Colom2 = styled.div`
    width: 50%;
    background: ${({ theme }) => theme.themeColor1};
`;

const Colom3 = styled.div`
    width: 25%;
    background: ${({ theme }) => theme.themeColor1};
`;

const Head =  styled.h4`
    border: 1px solid;
    border-radius: 10px;
    padding: 10px 20px;
`;

const menu = [
    {
        name:"Identity Verification",
        page: 1
    },
    {
        name: "Personal Details",
        page: 2
    },
    {
        name: "Address Details",
        page: 3,
        subMenu: [
            {
                name:'Co-applicant Details',
                page: 1
            },
            {
                name: 'Co-applicant Income Details',
                page: 2
            },
            {
                name:"Co-applicant Document Upload",
                page: 3
            }
        ]
    },
    {
        name: "Loan Details",
        page: 4
    },
    {
        name: "Document Upload",
        page: 5
    },
    {
        name: "Application Submitted",
        page: 2
    },
]

export default function Product({ product }) {
    return (
        <Wrapper>
            <Colom1>
                <a href='/'><Head active>Easy Ride <small>(Two wheeler loan)</small></Head></a>
                {
                    menu.map(m=>{
                        <a href='/' key={uuidv4()}><Head>{menu.name}</Head></a>
                    })
                }
            </Colom1>
            <Colom2>Colom 2</Colom2>
            <Colom3>Colom 3</Colom3>
        </Wrapper>)
}

Product.propTypes = {
    product: string.isRequired
};
